import * as React from 'react';
import {ImageCardList} from '../../components/ChooseImage';


interface IPage{
    dpage: string;
}


export function PageDisplay(props : string)  {

    const nav = props;

    if(nav=='1'){
    return(
        <ImageCardList/>
    );
    }else if(nav=='2'){
    return(
        <h1>HI</h1>
    );
    }else if(nav=='3'){
    return(
        <h1>HI</h1>
    );
    }else if(nav=='4'){
    return(
        <h1>HI</h1>
    );
    }else if(nav=='5'){
    return(
        <h1>HI</h1>
    );
    }

};

